script: |
  super -f text -I q160.spq | sort > q160.out

inputs:
  - name: q160.spq
    data: |
      SELECT ALL + col1 * - 55 AS col0, 17 + - col0 * + + col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q160.out
    data: |
      -1155	-853
      -4455	-688
      -55	-9586
